report = <<REPORT
Schools: 10
Students: 200
Year 3: 37
Year 5: 60
Year 7: 52
Year 9: 51


REPORT


describe "NAPLAN report on student file contents" do

    def post_csv(csv) 
        request = Net::HTTP::Post.new("/naplan/csv")
        request.body = csv
        request["Content-Type"] = "text/csv"
        @http.request(request)
    end

    before(:all) do
	config = NiasConfig.new
        @redis = config.redis
        @redis.flushdb
	@service_name = 'naplan_services_cons_prod_file_report_spec'
        @http = Net::HTTP.new("#{config.get_host}", "#{config.get_sinatra_port}") 
	@errorconsumer = Poseidon::ConsumerGroup.new("#{@service_name}_err#{rand(1000)}", ["#{config.kafka}"], ["#{config.zookeeper}"], "naplan.filereport", trail: true, socket_timeout_ms:6000, max_wait_ms:100)
	@errorconsumer.claimed.each { |x| @errorconsumer.checkout { |y| puts y.next_offset }}
        sleep 1
    end

    context "Valid CSV to naplan.csv" do
	before(:example) do
        	post_csv(csv)
		sleep 5
	end
        it "pushes report to naplan.filereport" do
            begin
		a = groupfetch(@errorconsumer)	
                expect(a).to_not be_nil
                expect(a.empty?).to be false
                expect(a[0].nil?).to be false
                expect(a[0].value.nil?).to be false
		received = a[0].value.lines[3..-1].join("")
                expect(received).to eq report
            rescue Poseidon::Errors::OffsetOutOfRange
                puts "[warning] - bad offset supplied, resetting..."
                offset = :latest_offset
                retry
            end
			
        end
    end

    after(:all) do
	@errorconsumer.close
	sleep 3
    end

end
